import React, { Component } from "react";

class CartItem extends Component {
  state = {
    productImg:
      "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.triproductphoto.com%2F&psig=AOvVaw1sGZhPlgWknAYrDo-tT20e&ust=1643199167560000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCMiVxYbwzPUCFQAAAAAdAAAAABAZ",
    producttitle: "Coffee maker",
    count: 1,
    price: "59$",
  };
  render() {
    return (
      <tr>
        <td>
          <img src={this.state.productImg} width="60" />
        </td>
        <td>{this.state.producttitle}</td>
        <td>{this.state.count}</td>
        <td>{this.state.price}</td>
      </tr>
    );
  }
}

export default CartItem;
